Vilniaus senamiesčio širdyje ilgalaikei nuomai nuomojamas naujai ir šiuolaikiškai įrengtas 2 kambarių butas/loftas Bazilijonų gatvėje. Aukštos 4 metrų lubos, kokybiškas įrengimas, grindinis šildymas ir rekuperacija. Namas rekonstruotas ir įtrauktas į UNESCO pasaulio paveldo sąrašą, pastatytas XIX amžiuje ir turi romantizmo bei istorizmo atspindį.NĖRA TARPININKAVIMO MOKESČIO, NUOMOJAMAS ILGALAIKEI NUOMAI NUO VIENERIŲ METŲ !LABAI EKONOMIŠKAS BUTO IŠLAIKYMAS. BUTAS JAU LAISVAS IR LAUKIA JŪSŲ !Butas nuomojamas su baldais ir visa reikalinga buitine technika - šaldytuvu, el. viryklė, gartraukiu, skalbimo mašina bei televizoriumi.
