Panoraminiai langai su plačiomis palangėmis lepins rytine gaiva ir įkvėps harmonijos, taip pat leis gerėtis visais metų laikais.Šiuolaikiškas butas ramioje Vilniaus senamiesčio dalyje, miesto renginiai netrikdys Jūsų ramybės, tačiau visas svarbiausias miesto vietas ir pramogas galėsite lengvai pasiekti pėsčiomis.BENDRA INFORMACIJA
