"Gilužio rivjera“ - mažaaukštės statybos gyvenvietė, vos 50 m nuo ežero kranto.
Puikiai sutvarkyta teritorija, įrengti dviračių takai, lauko treniruokliai, paplūdimys. Net trečdalis projekto teritorijos skirtas laisvalaikio erdvėms. Artimiausiu metu prie pergolių atsiras stacionarios lauko kepsninės, kur galėsite leisti laiką su savo draugais ar kaimynais. Šalia svečių namai „Villa Alicante“, SPA, kavinė, teniso kortai, restorano lauko terasa. Visas kvartalas yra jaukiai apšviestas, o saugumą užtikrina video kameros ir šlagbaumas. Teritoriją puošia medžiai ir augalai.
Tai puiki, rami ir privati gamtos apsupta vieta gyvenimui mieste.BENDRA INFORMACIJA
